package com.syntaxBatch11Class8;

public class ContinueKeyWordDemo3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		// print numbers from 1 to 15 except number 7 and 9 and 11
		
		for( int m=1;  m<=15;   m++) {
			
			if(m==7 || m==9  || m==11) {
				continue;
				
			} 
				System.out.print(m+" ");
			}
			
		}
		
		
	

}
